- input: "TEXT\x1CC00447243\x1C.TEXT\x1C\x1CF3XA\x1CDear Mr Norlfeet, Attached is
    the pre-convention amendment in response to your letter requesting additional
    information.  I would also like to resolve some of the questions you had.  First,
    the payment to the Republican National Committee was travel expense.  We were
    ntoified that once all travel expenses were finalized we would receive a refund
    if necessary.  Second, all expenses made have been for the Cappiello-Connecticut
    Victory '08 committee.  No in-kind contributions have been made so far on behalf
    of any federal candidate.  And lastly prining and photography expenses were not
    used for public communication or voter drive activity rather for a fundraising
    event.  Please let me know if you should have any further questions.  Regards,
    Jennifer D'Autrechy"
