    value: Dear Mr Norlfeet, Attached is the pre-convention amendment in response
      to your letter requesting additional information.  I would also like to resolve
      some of the questions you had.  First, the payment to the Republican National
      Committee was travel expense.  We were ntoified that once all travel expenses
